import React from "react";
import Button from "../ui/button";
import Logo from "../ui/logo";

function Nav() {
  return (
    <>
      <div className="navbar flex justify-left mx-10">
        <div className="basis-1/3 ">
          <Logo />
        </div>
        <div className="nav-pages basis-2/3 flex justify-end">
          <div className="text-center basis-2/5">
            <Button text="Tasks" url="/task" />
          </div>
          <div className="text-center basis-1/5">
            <Button text="Habits" url="/habit" />
          </div>
        </div>
      </div>
    </>
  );
}

export default Nav;
